import { createIcon } from "../icon/createIcon";

export const MoveVerticalIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MoveVerticalIcon">
    <path d="M5.25 7h1.5v2.001L9 9l-3 3-3-3 2.25.001V7zM6 0l3 3H6.75v2h-1.5V3H3l3-3z" />
  </svg>,
  "MoveVertical",
  "move vertical"
);
